import axios from 'axios'



function JoinedGame({changeUi}, {pData}, {gId}) {
  function getPlayers (){
    console.log(pData.id,gId,"JoinedGame")
  }
  
  return (
    <div>
        <p>Players: </p>
        <button onClick={getPlayers}>SHOW</button>

    </div>
  )
}

export default JoinedGame
